import React, { useState, useEffect } from "react";
import "../../styles/TeacherDashboard.css";
import logo from "../../assets/logo.png";
import { useNavigate } from "react-router-dom";
import Navbar from "../../components/Navbar"; // ✅ Import Navbar instead of repeating

const TeacherDashboard = () => {
  const navigate = useNavigate();
  const [activeDropdown, setActiveDropdown] = useState(null);

  // Toggle dropdown visibility
  const toggleDropdown = (menu) => {
    setActiveDropdown(activeDropdown === menu ? null : menu);
  };

  return (
    <div className="teacher-dashboard-layout">
      {/* ===== NAVBAR ===== */}
      <Navbar />

      {/* ===== BODY LAYOUT ===== */}
      <div className="teacher-body">
        {/* ===== SIDEBAR ===== */}
        <aside className="teacher-sidebar">
          {/* Dashboard Button */}
          <button onClick={() => navigate("/teacher-dashboard")}>
            <i className="fa-solid fa-house"></i> Dashboard
          </button>

          {/* ===== COURSES DROPDOWN ===== */}
          <div className="dropdown">
            <button
              className={activeDropdown === "course" ? "active" : ""}
              onClick={() => toggleDropdown("course")}
            >
              <i className="fa-solid fa-book"></i> Courses
            </button>
            {activeDropdown === "course" && (
              <div className="dropdown-menu">
                <ul>
                  <li onClick={() => navigate("/create-course")}>
                    Create Course
                  </li>
                  <li onClick={() => navigate("/view-courses")}>
                    View Courses
                  </li>
                  <li>Update Course</li>
                  <li>Delete Course</li>
                </ul>
              </div>
            )}
          </div>

          {/* ===== MCQ MANAGEMENT ===== */}
          <div className="dropdown">
            <button
              className={activeDropdown === "mcq" ? "active" : ""}
              onClick={() => toggleDropdown("mcq")}
            >
              <i className="fa-solid fa-list-check"></i> MCQ Management
            </button>
            {activeDropdown === "mcq" && (
              <div className="dropdown-menu">
                <ul>
                  <li>Create MCQ</li>
                  <li>Update MCQ</li>
                </ul>
              </div>
            )}
          </div>

          {/* Other Pages */}
          <button>
            <i className="fa-solid fa-briefcase"></i> Case Studies
          </button>

          <button>
            <i className="fa-solid fa-chart-line"></i> Reports
          </button>
        </aside>

        {/* ===== MAIN CONTENT ===== */}
        <main className="teacher-content">
          <h3>Quick Actions</h3>
          <div className="teacher-grid">
            <div className="tile">
              <i className="fa-solid fa-book-open"></i>
              <h4>Manage Courses</h4>
              <p>Create, update, or manage your course content.</p>
            </div>

            <div className="tile">
              <i className="fa-solid fa-list-check"></i>
              <h4>MCQ Posting</h4>
              <p>Upload and manage multiple-choice questions for students.</p>
            </div>

            <div className="tile">
              <i className="fa-solid fa-briefcase"></i>
              <h4>Case Studies</h4>
              <p>Upload and track case studies for classroom learning.</p>
            </div>

            <div className="tile">
              <i className="fa-solid fa-chart-line"></i>
              <h4>Reports</h4>
              <p>View student reports and analyze progress metrics.</p>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};

export default TeacherDashboard;
